package com.chasedream.leetcode.hard;

import com.chasedream.utils.Out;

import java.util.ArrayList;
import java.util.List;

/**
 * @author Zhang Dezhou
 * @Description leetcode:5367. 最长快乐前缀
 * @date 2020/3/22 12:23
 */
public class LongestPrefix {
    public static void main(String[] args) {
        LongestPrefix lp = new LongestPrefix();
        //String str = "";
        //String str = "leetcodeleeleet";
        String str = "ABABDABACDABABCABAB";
        String pat = "ABABAAABABAA";
        Out.println(lp.longestPrefix1(str, pat));
    }

    public String longestPrefix(String s) {
        int index = 0;
        for (int i = 1; i < s.length(); i++) {
            String a = s.substring(0, i);
            String b = s.substring(s.length() - i);
            if (a.equals(b)) {
                index = i;
            }
        }

        return index == s.length() ? "" : s.substring(0, index);
    }

    /**
     * 测试用例更新后，上面的方法会超时
     * 因此通过KMP方法求解
     *
     * @param s
     * @return
     */
    public String longestPrefix1(String s) {
        int[] next = new int[s.length() + 1];
        getNext(next, s);

        return s.substring(0, next[s.length()]);
    }

    /**
     * 找出所有的和pat在s中的起始下标
     *
     * @param s
     * @param pat
     * @return
     */
    public List<Integer> longestPrefix1(String s, String pat) {
        int[] next = new int[pat.length() + 1];
        getNext(next, pat);

        int i = -1;
        int j = -1;
        // 记录匹配到的字符串开始的下标
        List<Integer> indexes = new ArrayList<>();
        while (i < s.length()) {
            if (j == -1 || s.charAt(i) == pat.charAt(j)) {
                j++;
                i++;
            } else {
                j = next[j];
            }

            // 匹配到了一个字符串
            if (j == pat.length()) {
                indexes.add(i - j);
                j = next[j];
            }
        }
        return indexes;
    }

    /**
     * @param next
     * @param pat
     */
    private void getNext(int[] next, String pat) {
        int i = 1;
        int j = 0;
        next[0] = -1;

        while (i < pat.length()) {
            if (pat.charAt(i) == pat.charAt(j)) {
                next[++i] = ++j;
            } else {
                if (j == 0) {
                    next[i++] = 1;
                } else {
                    j = next[j];
                }
            }
        }
    }
}
